            $json['created']          = $this->created;
        }
        if (isset($this->modified)) {
            $json['modified']         = $this->modified;
        }
        if (isset($this->creator)) {
            $json['creator']          =
                ApiHelper::getJsonHelper()->verifyTypes(
                    $this->creator,
                    'anyOf(anyOf(string,LoginsResponse),null)'
                );
        }
        if (isset($this->modifier)) {
            $json['modifier']         = $this->modifier;
        }
        if (isset($this->configuration)) {
            $json['configuration']    =
                ApiHelper::getJsonHelper()->verifyTypes(
                    $this->configuration,
                    'anyOf(anyOf(string,ConfigurationsResponse),null)'
                );
        }
        if (isset($this->name)) {
            $json['name']             = ConfigurationStageNameEnum::checkValue($this->name);
        }
        if (isset($this->method)) {
            $json['method']           = ConfigurationStageMethodEnum::checkValue($this->method);
        }
        if (isset($this->sequence)) {
            $json['sequence']         = $this->sequence;
        }
        if (isset($this->input)) {
            $json['input']            = ConfigurationStageInputEnum::checkValue($this->input);
        }
        if (isset($this->output)) {
            $json['output']           = ConfigurationStageOutputEnum::checkValue($this->output);
        }
        if (isset($this->credential)) {
            $json['credential']       = ConfigurationStageCredentialsEnum::checkValue($this->credential);
        }
        if (isset($this->url)) {
            $json['url']              = $this->url;
        }
        if (isset($this->dir)) {
            $json['dir']              = $this->dir;
        }
        if (isset($this->restId)) {
            $json['restId']           = $this->restId;
        }
        if (isset($this->mapToData)) {
            $json['mapToData']        = $this->mapToData;
        }
        if (isset($this->file)) {
            $json['file']             = $this->file;
        }
        if (isset($this->filter)) {
            $json['filter']           = $this->filter;
        }
        if (isset($this->extension)) {
            $json['extension']        = ConfigurationStageExtensionEnum::checkValue($this->extension);
        }
        if (!empty($this->namespace)) {
            $json['namespace']        = $this->namespace['value'];
        }
        if (isset($this->dynamicStage)) {
            $json['dynamicStage']     = $this->dynamicStage;
        }
        if (!empty($this->curlOptions)) {
            $json['curlOptions']      = $this->curlOptions['value'];
        }
        if (isset($this->headers)) {
            $json['headers']          = $this->headers;
        }
        if (isset($this->callDelay)) {
            $json['callDelay']        = $this->callDelay;
        }
        if (isset($this->inactive)) {
            $json['inactive']         = InactiveEnum::checkValue($this->inactive);
        }
        if (isset($this->frozen)) {
            $json['frozen']           = FrozenEnum::checkValue($this->frozen);
        }
        if (!empty($this->fileConfigFilter)) {
            $json['fileConfigFilter'] = $this->fileConfigFilter['value'];
        }

        return (!$asArrayWhenEmpty && empty($json)) ? new stdClass() : $json;
    }
}
